import React from 'react';

const Home = () => {
  return (
    <div className='home'>
      <div className='card'>
      <div className='logreg'>
      <button className='loginbtn'>Login</button>
      <button className='registerbtn'>Register as</button>
      </div>
      </div>
    </div>
  );
};

export default Home;
